extension Exercise: Equatable, Hashable {
    public static func == (lhs: Exercise, rhs: Exercise) -> Bool {
        if lhs.id != rhs.id {
            return false
        }
        if lhs.name != rhs.name {
            return false
        }
        if lhs.description != rhs.description {
            return false
        }
        if lhs.muscleGroups != rhs.muscleGroups {
            return false
        }
        if lhs.equipmentNeeded != rhs.equipmentNeeded {
            return false
        }
        if lhs.difficultyLevel != rhs.difficultyLevel {
            return false
        }
        return true
    }

    public func hash(into hasher: inout Hasher) {
        hasher.combine(id)
        hasher.combine(name)
        hasher.combine(description)
        hasher.combine(muscleGroups)
        hasher.combine(equipmentNeeded)
        hasher.combine(difficultyLevel)
    }
}

